script: |
  super -f text -I q5350.spq | sort > q5350.out

inputs:
  - name: q5350.spq
    data: |
      SELECT - + 2 * - COUNT ( * ) AS col0 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab1
  - name: tab2

outputs:
  - name: q5350.out
    data: |
      18
